import React from "react";


const content = () => {
  return (
    <div className='will-change: transform; transition: 1000ms cubic-bezier(0.03, 0.98, 0.52, 0.99); transform: perspective(1000px) rotateX(0deg) rotateY(0deg) scale3d(1, 1, 1);'>
      <p className="txt text-6xl sm:text-7xl md:text-9xl font-bold tracking-wide">
        Amine
      </p>
    </div>
  );
};

export default content;
